export type HomiIconType = keyof typeof iconPack;

const homiIconCollections = (iconName: keyof typeof iconPack) => {
  if (Boolean(iconPack[iconName]))
    return {
      width: 32,
      height: 32,
      ...iconPack[iconName],
    };

  return null;
};

export default homiIconCollections;
